const activeTabs = {
  FIRST: 'FIRST',
  SECOND: 'SECOND',
  THIRD: 'THIRD'
}

const textForTab = [
  {value: activeTabs.FIRST, title: 'accordion'},
  {value: activeTabs.SECOND, title: 'table'},
  {value: activeTabs.THIRD, title: 'snackbars'}
]

export {
    textForTab,
    activeTabs
}
